import React from 'react';
import Navbar from '../components/Navbar';
import Footer from '../components/Footer';

const MyOrder = () => {
    return(
        <div>
        <div>
            <Navbar/>
        </div>
        <div>
            <h1>My order</h1>
        </div>
        <div>
            <Footer/>
        </div>
        </div>
    );
}


export default MyOrder;
